import * as s from '../styles/DeliveryInfoStyle';

const DeliveryType = [
  {
    name: '직접픽업',
    value: 'pickup',
  },
  {
    name: '안전배송',
    value: 'safeDelivery',
  },
  {
    name: '일반배송',
    value: 'normalDelivery',
  },
];

export const DeliveryInfo = () => {
  return (
    <s.DeliveryInfoContainer>
      <s.DeliveryInfoUl>
        {DeliveryType.map((item) => (
          <s.DeliveryInfoLi key={item.value}>{item.name}</s.DeliveryInfoLi>
        ))}
      </s.DeliveryInfoUl>
    </s.DeliveryInfoContainer>
  );
};

export default DeliveryInfo;
